import React from 'react';
import './styles/login-reg.css';
import logo from '../assets/momentuslogo.png';

function Register() {
  const [email, setEmail] = React.useState('');
  const [username, setUsername] = React.useState('');
  const [password, setPassword] = React.useState('');
  const [confirmPass, setConfirmPass] = React.useState('');
  const [firstName, setFirstName] = React.useState('');
  const [lastName, setLastName] = React.useState('');
  const [city, setCity] = React.useState('');
  const [state, setState] = React.useState('');
  const [DOB, setDOB] = React.useState('');

  return (
    <div className="login-reg-wrapper">
      <div className="login-reg-box">
        <img src={logo} />
        <h1>Create Account</h1>
        <div className="input-box">
          <form id="/userregister" action="back_end/server/createUser" method="POST">
            <input type="email" placeholder="Email" onChange={(e) => setEmail(e.target.value)} /><br />
            <input type="text" placeholder="Username"  onChange={(e) => setUsername(e.target.value)} /><br />
            <input type="password" placeholder="Password"  onChange={(e) => setPassword(e.target.value)} /><br />
            <input type="password" placeholder="Confirm Password" onChange={(e) => setEmail(e.target.value)} />
            <input type="text" placeholder="First Name" onChange={(e) => setEmail(e.target.value)} /><br />
            <input type="text" placeholder="Last Name" onChange={(e) => setEmail(e.target.value)} /><br />
            <input type="text" placeholder="City" id="city" onChange={(e) => setEmail(e.target.value)} /><br />
            <input type="text" placeholder="State" id="state" onChange={(e) => setEmail(e.target.value)} /><br />
            <label>Date of birth</label><br />
            <input type="date" placeholder="Date of Birth" id="DOB" /><br />
            <input type="submit" value="Register" /><br />
          </form>
          <br />
        </div>
        <a href="/login">Log in instead</a><br />
        <p>email: {email}</p>
      </div>
    </div>
  );
}

export default Register;
